import React from 'react';
import '../../Assets/style/style.css';
import './style.css';
const About = () => {
    return (
        <section className="half-black-half-white " id="about">
            <h5 className="header">About</h5>
            <div class="header-bar"></div>
            <Container>
                <Row>
                    <Col>1 of 2</Col>
                    <Col>2 of 2</Col>
                </Row>
            </Container>
        </section>
    );
};

export default About;
